import React, { Component } from 'react'
import PropTypes from 'prop-types'; 

export class TodoItem extends Component {
    render() {
        return (
            <div>
                <h2>{this.props.todo.id}</h2>
            </div>
        )
    }
}

TodoItem.propTypes = {
    todo: PropTypes.object.isRequired,
}

export default TodoItem
